import React from "react";
import BreakInterval from './Break';
import SessionLength from './SessionLenght';

class Timer extends React.Component {
  constructor() {
    super();

    this.state = {
      break: 5,
      sessionLenght: 25,
    }
  }
  render() {
    return (
      <main>
        <p>Hello !</p>
        <BreakInterval breakInterval={this.state.break} />
        <SessionLength sessionLenght={this.state.sessionLenght} />
      </main>
    );
  }
}




export default Timer;
